bool BkkMenu::CheckBox(const char* label, bool* v)
{
	ImGuiWindow* window = ImGui::GetCurrentWindow();
	if (window->SkipItems)
		return false;
	ImGuiContext& g = *GImGui;
	const ImGuiStyle& style = g.Style;
	const ImGuiID id = window->GetID(label);
	const ImVec2 label_size = ImGui::CalcTextSize(label, NULL, true);
	//const ImRect check_bb(window->DC.CursorPos, ImVec2_add(window->DC.CursorPos, ImVec2(label_size.y + style.FramePadding.y * 2, label_size.y + style.FramePadding.y * 2)));
	const ImRect check_bb(window->DC.CursorPos, ImVec2_add(window->DC.CursorPos, ImVec2(label_size.y + style.FramePadding.y * 0.625, label_size.y + style.FramePadding.y * 0.625)));
	ImGui::ItemSize(check_bb, style.FramePadding.y);

	ImRect total_bb = check_bb;
	if (label_size.x > 0)
	{
		ImGui::SameLine(0, style.ItemInnerSpacing.x);
	}
	const ImRect text_bb(ImVec2_add(window->DC.CursorPos, ImVec2(0, style.FramePadding.y)), ImVec2_add(window->DC.CursorPos, ImVec2_add(ImVec2(0, style.FramePadding.y), label_size)));
	if (label_size.x > 0)
	{
		ImGui::ItemSize(ImVec2(text_bb.GetWidth(), check_bb.GetHeight()), style.FramePadding.y);
		total_bb = ImRect(ImMin(check_bb.Min, text_bb.Min), ImMax(check_bb.Max, text_bb.Max));
	}

	if (!ImGui::ItemAdd(total_bb, id))
		return false;

	bool hovered, held;
	bool pressed = ImGui::ButtonBehavior(total_bb, id, &hovered, &held);
	if (pressed)
		*v = !(*v);

	ImGui::RenderFrame(check_bb.Min, check_bb.Max, ImGui::GetColorU32((held && hovered) ? ImGuiCol_FrameBgActive : hovered ? ImGuiCol_FrameBgHovered : ImGuiCol_FrameBg), true, style.FrameRounding);
	if (*v)
	{
		ImGui::PushStyleColor(ImGuiCol_CheckMark, ImVec4(0.431f, 0.588f, 0.176f, 1.f));
		const float check_sz = ImMin(check_bb.GetWidth(), check_bb.GetHeight());
		const float pad = ImMax(1.0f, (float)(int)(check_sz / 6.0f));
		window->DrawList->AddRectFilled(ImVec2_add(check_bb.Min, ImVec2(pad, pad)), ImVec2_sub(check_bb.Max, ImVec2(pad, pad)), ImGui::GetColorU32(ImGuiCol_CheckMark), style.FrameRounding);
		ImGui::PopStyleColor();
	}

	if (label_size.x > 0.0f)
		ImGui::RenderText(text_bb.GetTL(), label);
	return pressed;
}

